import axios from 'axios';

const baseUrl = 'http://127.0.0.1:5000';

export const getMessage = () => {
    return axios.get('http://127.0.0.1:5000/testingApi')
        .then(response => response.data)
        .catch(error => {
            console.error('Error fetching data:', error);
            throw error;
        })
}
